INSERT INTO `mdl_course` VALUES (1,0,1,'Collaborative Learning','Colle','','<p>Selamat Datang di Colle Moodle~ </p>',0,'site',1,3,0,0,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1712902064,1712902426,0,0,0,1713866495,NULL,0,NULL,NULL),(2,1,10009,'Quiz','Quiz','','',1,'topics',1,5,1712941200,0,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1712908313,1712941046,0,1,0,1713866550,NULL,1,1,NULL),(3,1,10008,'Dasar-Dasar Pemrogramman','DDP','','<p>Memberikan pemahaman dasar tentang konsep pemrograman komputer menggunakan bahasa pemrograman seperti Python atau Java. Mahasiswa akan belajar tentang struktur data, pengendalian alur program, dan pemecahan masalah sederhana melalui pemrograman.</p>',1,'topics',1,5,1712911680,0,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1712909093,1712932555,0,1,0,1713866495,NULL,0,1,NULL),(4,1,10007,'Desain dan Analisis Algoritma ','DAA','','<p>Berfokus pada konsep-konsep dasar desain dan analisis algoritma. Mahasiswa akan belajar tentang teknik pemecahan masalah, kompleksitas algoritma, dan strategi desain algoritma seperti divide and conquer, dynamic programming, dan greedy algorithms.</p>\r\n<p></p>',1,'topics',1,5,1713027600,1744563600,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713002950,1713002950,0,1,0,1713866495,NULL,1,1,NULL),(5,1,10006,'Pengembangan Aplikasi Web','PAW','','<p dir=\"ltr\">konsep dan teknologi yang terkait dengan pengembangan aplikasi web. Mahasiswa akan belajar tentang bahasa pemrograman web seperti HTML, CSS, JavaScript, serta framework dan tools untuk membangun aplikasi web modern.</p>\r\n<p></p>',1,'topics',1,5,1713027600,1744563600,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713010243,1713010295,0,1,0,1713866495,NULL,1,1,NULL),(6,1,10005,'Jaringan Komputer','JK','','<p>Course ini membahas prinsip-prinsip dasar jaringan komputer, protokol komunikasi, arsitektur jaringan, dan teknologi terkini dalam pengembangan jaringan komputer. Mahasiswa juga akan belajar tentang keamanan jaringan dan manajemen jaringan.</p>\r\n<p></p>',1,'topics',1,5,1713027600,1744563600,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713010566,1713010566,0,1,0,1713866495,NULL,1,1,NULL),(7,1,10004,'Artificial Intelligence','AI','','<p>Course inimemperkenalkan konsep-konsep dasar kecerdasan buatan, termasuk pemrosesan bahasa alami, machine learning, dan neural networks. Mahasiswa akan belajar tentang aplikasi kecerdasan buatan dalam berbagai bidang seperti pengolahan citra, pengenalan suara, dan analisis data.</p>\r\n<p></p>',1,'topics',1,5,1713027600,1744563600,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713011393,1713011393,0,1,0,1713866495,NULL,1,1,NULL),(8,1,10003,'Pengolahan Citra dan Grafika Komputer','PCD','','<p dir=\"ltr\">Kursus ini membahas prinsip-prinsip dasar pengolahan citra digital dan grafika komputer. Mahasiswa akan mempelajari teknik-teknik dasar dalam manipulasi citra, pengenalan pola, dan pembuatan grafika komputer 2D dan 3D.</p>\r\n<p></p>',1,'topics',1,5,1713027600,1744563600,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713012195,1713012195,0,1,0,1713866495,NULL,1,1,NULL),(9,1,10002,'Komputer Grafik','komgraf','','komgraf',1,'topics',1,5,0,0,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713679698,1713679698,0,1,0,1713866495,NULL,0,1,NULL),(10,1,10001,'Dasar Dasar Pemograman 2','DDP2','','ddp',1,'topics',1,5,0,0,0,0,0,0,0,1,1,NULL,0,0,0,'','','',1713690818,1713690818,0,1,0,1713866495,NULL,0,1,NULL);
