INSERT INTO `mdl_page` VALUES (1,3,'Kontrak Perkuliahan Dasar-Dasar Pemrograman','',1,'<ol>\r\n<li><strong>Tugas Individu</strong>\r\n<ul>\r\n<li>Setiap dua minggu, mahasiswa akan diberikan tugas pemrograman yang relevan dengan materi yang telah dipelajari.</li>\r\n<li>Tugas-tugas ini harus diselesaikan secara individu dan dikumpulkan sesuai dengan jadwal yang ditentukan.</li>\r\n<li>Batas waktu pengumpulan tugas tidak boleh melebihi satu minggu setelah tugas diberikan.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Ujian Tengah Semester:</strong>\r\n<ul>\r\n<li>Ujian tengah semester akan mencakup materi yang telah dipelajari sejak awal semester hingga sebelum ujian tersebut dilaksanakan.</li>\r\n<li>Format ujian akan terdiri dari soal-soal pilihan ganda, isian singkat, dan penyelesaian kode program.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Ujian Akhir Semester:</strong>\r\n<ul>\r\n<li>Ujian akhir semester akan mencakup keseluruhan materi yang telah dipelajari selama semester.</li>\r\n<li>Format ujian akan terdiri dari soal-soal pilihan ganda, isian singkat, analisis kode program, dan implementasi kode program.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Praktikum:</strong>\r\n<ul>\r\n<li>Mahasiswa akan dijadwalkan untuk mengikuti sesi praktikum yang relevan dengan materi kuliah.</li>\r\n<li>Selama praktikum, mahasiswa akan diberikan tugas-tugas pemrograman praktis untuk mengasah keterampilan pemrograman yang telah dipelajari.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Penilaian:</strong>\r\n<ul>\r\n<li>Tugas-tugas individu akan dinilai berdasarkan kualitas kode, kebenaran logika program, dan dokumentasi yang jelas.</li>\r\n<li>Ujian tengah dan akhir semester akan dinilai berdasarkan pemahaman konsep, kemampuan menganalisis dan memecahkan masalah, serta penerapan konsep dalam kode program.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Keterlambatan</strong>:\r\n<ul>\r\n<li>Tugas yang dikumpulkan melebihi batas waktu yang ditentukan akan dikenai penalti berupa pengurangan nilai sesuai kebijakan yang telah ditetapkan.</li>\r\n<li>Tidak ada pengecualian untuk keterlambatan, kecuali atas alasan yang sah dan mendapat persetujuan dari dosen pengampu sebelum batas waktu pengumpulan.</li>\r\n</ul>\r\n</li>\r\n</ol>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1712997892),(2,3,'Pengantar Algoritma','<p>Algoritma adalah serangkaian langkah atau instruksi yang terstruktur secara logis untuk menyelesaikan suatu masalah atau mencapai suatu tujuan tertentu. Dalam pengembangan perangkat lunak, algoritma menjadi pondasi utama dalam proses perancangan dan pemecahan masalah. Penggunaan algoritma memungkinkan programmer untuk merancang solusi yang efisien dan efektif untuk berbagai permasalahan yang kompleks.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/60K7zxIjHQo?si=lj3ULec7WuGZb-JJ\">\r\n    https://youtu.be/60K7zxIjHQo?si=lj3ULec7WuGZb-JJ\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713004971),(3,3,'Video Pembelajaran','<p>Variabel adalah lokasi penyimpanan yang dapat diidentifikasi oleh sebuah nama dan digunakan untuk menyimpan nilai di dalam program. Setiap variabel memiliki tipe data tertentu yang menentukan jenis nilai yang dapat disimpan di dalamnya.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/1oN7JxLTVzA?si=J00D0rGurjUmYDnJ\">\r\n    https://youtu.be/1oN7JxLTVzA?si=J00D0rGurjUmYDnJ\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713005034),(4,3,'Video Pembelajaran','<p>Percabangan dan perulangan merupakan konsep dasar dalam pengembangan perangkat lunak yang sangat penting. Dengan menggunakan percabangan, program dapat membuat keputusan secara dinamis berdasarkan kondisi yang diberikan, sementara dengan perulangan, program dapat menjalankan serangkaian tugas secara otomatis tanpa harus menulis kode yang sama berulang kali.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/D55geajHYQU?si=2116_xtjOgcCqFA8\">\r\n    https://youtu.be/D55geajHYQU?si=2116_xtjOgcCqFA8\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713005107),(5,3,'Video Pembelajaran','<p>Video ini bertujuan untuk memberikan pemahaman yang mendalam tentang konsep fungsi dan prosedur dalam pemrograman komputer. Melalui video ini, mahasiswa akan dibimbing untuk memahami secara komprehensif perbedaan antara fungsi dan prosedur, serta bagaimana cara mendefinisikan, menggunakan, dan memanfaatkannya dalam pengembangan program.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/D6ytQnmH6ok?si=qtMBJ20bWPdiReoa\">\r\n    https://youtu.be/D6ytQnmH6ok?si=qtMBJ20bWPdiReoa\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713005184),(6,3,'Video Pembelajaran (Array)','<p>Video ini bertujuan untuk memberikan pemahaman yang mendalam tentang konsep array dalam pemrograman komputer. Melalui video ini, mahasiswa akan diajak untuk memahami secara detail bagaimana array bekerja, cara mendeklarasikan, menginisialisasi, dan mengakses elemen-elemen array, serta bagaimana mengimplementasikannya dalam pengembangan program dengan efektif.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/8WhUADLI4RQ?si=bYC5j52vxrpWnX_w\">\r\n    https://youtu.be/8WhUADLI4RQ?si=bYC5j52vxrpWnX_w\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713005399),(7,3,'Video Pembelajaran (String)','<p>Video ini bertujuan untuk memberikan pemahaman yang mendalam tentang konsep string dalam pemrograman komputer. Melalui video ini, mahasiswa akan diajak untuk memahami secara detail bagaimana string bekerja, bagaimana cara memanipulasi string, serta bagaimana mengimplementasikannya dalam pengembangan program dengan efektif.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/VDgITwX6bKo?si=0slsTeqnihIka3Vg\">\r\n    https://youtu.be/VDgITwX6bKo?si=0slsTeqnihIka3Vg\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',3,1713005418),(8,4,'Video Pembelajaran Konsep dasar Algoritma','<p>Hampir semua aktivitas pemrograman tidak bisa lepas dari yang namanya algoritma yang sudah menjadi dasar dalam membuat suatu program. Algoritma sendiri adalah suatu urutan atau alur yang dipakai dalam perhitungan atau pemecahan masalah secara sistematis. Kalau dalam aktivitas pemrograman, algoritma seringkali dianggap sebagai logika dalam penentuan program yang akan dibuat. Tapi, apa hubungan sebenarnya dari algoritma dengan pemrogaman? Enjoy the video!</p>',1,'<p><a href=\"https://www.youtube.com/watch?v=uqVJc9lLknA\">Algoritma dan Pemrograman</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713003838),(9,4,'Video Pembelajaran','',1,'<p><a href=\"https://www.youtube.com/watch?v=YOh6hBtX5l0\">Divide &amp; Conquer Algorthm</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713005628),(10,5,'Video Pembelajaran','<p>Pelajari dasar-dasar HTML, CSS, dan Javascript dalam 30 menit. Video ini agar siapa pun yang tidak memiliki banyak waktu dalam jadwal mereka dapat mempelajari dasar-dasar HTML, CSS, dan Javascript.</p>',1,'<p><a href=\"https://www.youtube.com/watch?v=_GTMOmRrqkU\">HTML, CSS, and Javascript</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713010545),(11,5,'Video Pembelajaran','<p>Video ini membahas tentang review / ulasan tentang berbagai framework yang dapat digunakan untuk mengembangkan sebuah website. Framework ternyata sangat banyak. Dari masing-masing bahasa pemrograman juga bisa memiliki beberapa framework. Video ini memperkenalkan berbagai framework tersebut dan yang sering digunakan.</p>',1,'<p><a href=\"https://www.youtube.com/watch?v=pEVpu4xL1U8\">Framework Website</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',2,1713011681),(12,5,'Video Pembelaran','<p>Web Programming</p>',1,'<p><a href=\"https://www.youtube.com/playlist?list=PLFIM0718LjIW7AsIbnhFg15t9yx4H-sQ0\">RestFul API</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713011746),(13,7,'Kontrak Perkuliahan Artificial Intelligence','<p>Kontrak ini mengatur syarat dan ketentuan untuk perkuliahan mata kuliah Artificial Intelligence (AI) antara dosen pengajar dan mahasiswa yang terdaftar dalam mata kuliah ini. Mata kuliah ini bertujuan untuk memberikan pemahaman mendalam tentang konsep-konsep dasar, teknik, dan aplikasi dari kecerdasan buatan.</p>',1,'<ol>\r\n<li>Penilaian:\r\n<ul>\r\n<li>Penilaian mahasiswa akan terdiri dari berbagai komponen, dengan bobot sebagai berikut:\r\n<ul>\r\n<li>Ujian Tengah Semester: 30%</li>\r\n<li>Ujian Akhir Semester: 40%</li>\r\n<li>Tugas Individu dan Kelompok: 20%</li>\r\n<li>Partisipasi dalam Diskusi dan Presentasi: 10%</li>\r\n</ul>\r\n</li>\r\n<li>Penilaian akan didasarkan pada pencapaian pembelajaran, kualitas pekerjaan, keterlibatan, dan kemajuan mahasiswa selama perkuliahan.</li>\r\n</ul>\r\n</li>\r\n<li>Etika dan Plagiarisme:\r\n<ul>\r\n<li>Mahasiswa diharapkan untuk mentaati kode etik akademik dan menghindari segala bentuk plagiasi.</li>\r\n<li>Plagiasi dalam bentuk apapun akan mengakibatkan tindakan disiplin sesuai peraturan universitas.</li>\r\n</ul>\r\n</li>\r\n<li>Konsultasi:\r\n<ul>\r\n<li>Dosen pengajar akan menyediakan waktu konsultasi untuk mahasiswa yang membutuhkan bantuan tambahan dalam memahami materi perkuliahan.</li>\r\n<li>Mahasiswa dianjurkan untuk memanfaatkan kesempatan konsultasi ini secara aktif.</li>\r\n</ul>\r\n</li>\r\n<li>Perubahan Jadwal:\r\n<ul>\r\n<li>Dosen pengajar berhak untuk membuat perubahan jadwal perkuliahan dengan pemberitahuan sebelumnya kepada mahasiswa.</li>\r\n<li>Perubahan signifikan dalam jadwal akan diinformasikan dengan cara yang paling memungkinkan.</li>\r\n</ul>\r\n</li>\r\n<li>Pencapaian Pembelajaran:\r\n<ul>\r\n<li>Mahasiswa diharapkan untuk mencapai tujuan pembelajaran yang telah ditetapkan dalam mata kuliah ini.</li>\r\n<li>Bantuan tambahan akan disediakan bagi mahasiswa yang mengalami kesulitan dalam mencapai tujuan pembelajaran.</li>\r\n</ul>\r\n</li>\r\n<li>Ketentuan Tambahan:\r\n<ul>\r\n<li>Ketentuan tambahan dapat ditambahkan jika diperlukan, dengan persetujuan bersama antara dosen pengajar dan mahasiswa.</li>\r\n</ul>\r\n</li>\r\n</ol>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713012411),(14,8,'Video Pembelajaran','<p>Video ini berisi pemaparan mengenai konsep dasar citra digital yang meliputi definisi citra digital, akuisisi citra digital, dan struktur data pada citra digital.</p>',1,'<p><a href=\"https://www.youtube.com/watch?v=vMXTEXYQ4RM&amp;list=PLBW2heg-PA3e_1ObQponUnL8I-eZWRbCy&amp;index=1\">Konsep dasar</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713012993),(15,8,'Video Pembelajaran','<p>Pada materi hari ini di jelaskan tentang konsep perbedaan 2D dan 3D. Cara menentukan lokasi titik 3 dimensi, sifat-sifat 3 dimensi dampai dengan representasi titik 3 dimensi. Untuk lebih jelasnya, kita simak yuk video nya.</p>',1,'<p><a href=\"https://www.youtube.com/watch?v=TYBKIz0VOyI\">Grafika Komputer</a></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713013275),(16,7,'Video Pembelajaran','<p>Natural Language Processing (NLP) adalah cabang ilmu kecerdasan buatan yang berfokus pada pemahaman dan pengolahan bahasa manusia secara alami oleh komputer. Dalam video ini, Anda akan diperkelnalkan apa itu NLP.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/tWQ2Il0NBkY?si=wDBQKy3i6Uny8Yy0\">\r\n    https://youtu.be/tWQ2Il0NBkY?si=wDBQKy3i6Uny8Yy0\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713014399),(17,7,'Video Pembelajaran','<p>Machine Learning adalah paradigma dalam kecerdasan buatan yang memungkinkan komputer untuk belajar dari data tanpa perlu diprogram secara eksplisit. Dalam video ini, Anda akan menjelajahi konsep dasar machine learning, sebagai pengantar dalam mempelajari machine learning lebih lanjut</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/mEwoAV5_dcA?si=kAZIK1iYDs8hDI5O\">\r\n    https://youtu.be/mEwoAV5_dcA?si=kAZIK1iYDs8hDI5O\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713014536),(18,7,'Video Pengantar Pembelajaran','<p>Neural Networks (Jaringan Saraf Tiruan) adalah model matematika terinspirasi dari struktur jaringan saraf biologis manusia. Dalam video ini, Anda akan diajak untuk menjelajahi konsep dasar jaringan saraf tiruan, termasuk neuron, layer, dan arsitektur yang berbeda seperti jaringan saraf sederhana, jaringan saraf berlapis (deep learning), dan berbagai jenis fungsi aktivasi.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/aircAruvnKk?si=PkbSwXlP2-MT0YN4\">\r\n    https://youtu.be/aircAruvnKk?si=PkbSwXlP2-MT0YN4\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713014666),(19,6,'Kontrak Perkuliahan Jaringan Komputer','',1,'<ol>\r\n<li>Tujuan Mata Kuliah:\r\n<ul>\r\n<li>Memahami konsep dasar jaringan komputer, termasuk topologi, arsitektur, dan protokol.</li>\r\n<li>Menguasai teknik desain, implementasi, dan manajemen jaringan komputer.</li>\r\n<li>Mampu menerapkan pengetahuan tentang jaringan komputer dalam solusi teknis yang kompleks.</li>\r\n</ul>\r\n</li>\r\n<li>Materi Perkuliahan:\r\n<ul>\r\n<li>Materi perkuliahan akan mencakup tetapi tidak terbatas pada:\r\n<ul>\r\n<li>Konsep Dasar Jaringan Komputer.</li>\r\n<li>Model Referensi OSI dan TCP/IP.</li>\r\n<li>Protokol Komunikasi.</li>\r\n<li>Teknologi Jaringan, seperti Ethernet, WLAN, dan WAN.</li>\r\n<li>Keamanan Jaringan.</li>\r\n<li>Desain dan Manajemen Jaringan.</li>\r\n</ul>\r\n</li>\r\n<li>Materi perkuliahan akan disampaikan melalui kuliah, diskusi, studi kasus, dan praktikum.</li>\r\n</ul>\r\n</li>\r\n<li>Penilaian:\r\n<ul>\r\n<li>Penilaian mahasiswa akan terdiri dari berbagai komponen, termasuk tetapi tidak terbatas pada:\r\n<ul>\r\n<li>Ujian Tengah Semester.</li>\r\n<li>Ujian Akhir Semester.</li>\r\n<li>Tugas Individu dan Kelompok.</li>\r\n<li>Partisipasi dalam Diskusi dan Presentasi.</li>\r\n<li>Proyek Implementasi Jaringan.</li>\r\n</ul>\r\n</li>\r\n<li>Bobot setiap komponen penilaian akan dijelaskan secara rinci dalam silabus mata kuliah.</li>\r\n</ul>\r\n</li>\r\n<li>Etika dan Kerjasama:\r\n<ul>\r\n<li>Mahasiswa diharapkan untuk mematuhi etika akademik, menghormati hak kekayaan intelektual, dan menghindari tindakan plagiasi.</li>\r\n<li>Kerjasama dalam tugas kelompok diperbolehkan asalkan kontribusi individu jelas dan setiap mahasiswa memahami materi yang dikerjakan.</li>\r\n</ul>\r\n</li>\r\n<li>Konsultasi:\r\n<ul>\r\n<li>Dosen pengajar akan menyediakan waktu konsultasi untuk mahasiswa yang membutuhkan bantuan tambahan dalam memahami materi perkuliahan.</li>\r\n<li>Mahasiswa dianjurkan untuk aktif mengikuti konsultasi dan memanfaatkan sumber daya yang tersedia.</li>\r\n</ul>\r\n</li>\r\n<li>Perubahan Jadwal:\r\n<ul>\r\n<li>Dosen pengajar berhak untuk membuat perubahan jadwal perkuliahan dengan pemberitahuan sebelumnya kepada mahasiswa.</li>\r\n<li>Perubahan signifikan dalam jadwal akan diinformasikan sesegera mungkin.</li>\r\n</ul>\r\n</li>\r\n<li>Pencapaian Pembelajaran:\r\n<ul>\r\n<li>Mahasiswa diharapkan untuk mencapai tujuan pembelajaran yang telah ditetapkan dalam mata kuliah ini.</li>\r\n<li>Bantuan tambahan akan disediakan bagi mahasiswa yang mengalami kesulitan dalam mencapai tujuan pembelajaran.</li>\r\n</ul>\r\n</li>\r\n</ol>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713016669),(20,6,'Video Pengantar Pembelajaran','<p>Video ini memberikan gambaran umum tentang konsep dasar jaringan komputer. Mulai dari pengertian jaringan komputer itu sendiri, jenis-jenis jaringan (LAN, WAN, MAN), hingga komponen-komponen utama yang membentuk sebuah jaringan komputer.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/WPhjxoVDygk?si=H4qqZX91HKHUC2wc\">\r\n    https://youtu.be/WPhjxoVDygk?si=H4qqZX91HKHUC2wc\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713017606),(21,6,'Materi Pengantar Pembelajaran','<p>Video ini menjelaskan tentang protokol komunikasi yang menjadi dasar dari interaksi antarperangkat dalam jaringan komputer.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/UJn-fbxWbGs?si=-5lydcaRsVFtnm6d\">\r\n    https://youtu.be/UJn-fbxWbGs?si=-5lydcaRsVFtnm6d\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713017780),(22,6,'Video Pengantar Arsitektut Jaringan','<p>Video ini fokus pada pembahasan tentang arsitektur jaringan yang mencakup desain dan struktur jaringan komputer.</p>',1,'<p><video controls=\"controls\">\r\n        <source src=\"https://youtu.be/92yvHHEgxG0?si=yr9pFrVMgMKcqvPV\">\r\n    https://youtu.be/92yvHHEgxG0?si=yr9pFrVMgMKcqvPV\r\n</video></p>',1,0,NULL,5,'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}',1,1713017922);
