INSERT INTO `mdl_question_attempts` VALUES (156,19,1,'deferredfeedback',22,1,1.0000000,0.0000000,1.0000000,0,'Berapakah hasil dari ekspresi berikut dalam pemrograman: (4 > 3) and (5 < 2)?\n\n: Tidak ada hasil\n; False\n; Error\n; True\n','False\n',NULL,1712922951),(157,19,2,'deferredfeedback',23,1,1.0000000,0.0000000,1.0000000,0,'Apakah output dari program berikut dalam bahasa pemrograman Python?\n\nx=5\nifx>10:\nprint(\"xlebihbesardari10\")\nelifx<10:\nprint(\"xkurangdari10\")\nelse:\nprint(\"xsamadengan10\")\n: x kurang dari 10\n; x sama dengan 10\n; Tidak ada output\n; x lebih besar dari 10\n','x kurang dari 10\n',NULL,1712922953),(158,19,3,'deferredfeedback',24,1,1.0000000,0.0000000,1.0000000,0,'Apakah hasil dari ekspresi berikut dalam pemrograman: not (3 > 5)?\n: Error\n; True\n; Tidak ada hasil\n; False\n','True\n',NULL,1712922917),(159,19,4,'deferredfeedback',25,1,1.0000000,0.0000000,1.0000000,0,'Berapakah nilai dari ekspresi berikut dalam pemrograman: (8 >= 8) and (7 != 7)?\n: Tidak ada hasil\n; Error\n; False\n; True\n','False\n',NULL,1712922917),(160,19,5,'deferredfeedback',26,1,1.0000000,0.0000000,1.0000000,0,'Jika x = 7 dan y = 10, apa hasil dari ekspresi berikut dalam pemrograman: (x > 5) and (y < 15)?\n: False\n; True\n; Error\n; Tidak ada hasil\n','True\n',NULL,1712922917),(161,19,6,'deferredfeedback',27,1,1.0000000,0.0000000,1.0000000,0,'Apakah output dari program berikut dalam bahasa pemrograman C++?\n\nintx=20;\nif(x>10){\nif(x<30){\ncout<<\"xadalahbilanganantara10dan30\";\n}\n}\n: Tidak ada output\n; Output tidak bisa diprediksi\n; x adalah bilangan antara 10 dan 30\n; Error\n','x adalah bilangan antara 10 dan 30\n',NULL,1712922917),(162,19,7,'deferredfeedback',28,1,1.0000000,0.0000000,1.0000000,0,'Berapakah hasil dari ekspresi berikut dalam pemrograman: (10 <= 5) or (3 == 3)?\n: Error\n; False\n; Tidak ada hasil\n; True\n','True\n',NULL,1712922917),(163,19,8,'deferredfeedback',30,1,1.0000000,0.0000000,1.0000000,0,'Jika x = 8 dan y = 12, apa hasil dari ekspresi berikut dalam pemrograman: (x >= 10) or (y < 10)?\n: Error\n; Tidak ada hasil\n; True\n; False\n','True\n',NULL,1712922917),(164,19,9,'deferredfeedback',33,1,1.0000000,0.0000000,1.0000000,0,'Apakah hasil dari ekspresi berikut dalam pemrograman: (6 > 3) or (9 < 5)?\n: False\n; Error\n; Tidak ada hasil\n; True\n','True\n',NULL,1712922917),(165,19,10,'deferredfeedback',36,1,1.0000000,0.0000000,1.0000000,0,'Berapakah nilai dari ekspresi berikut dalam pemrograman: (8 != 8) and (5 < 10)?\n: Tidak ada hasil\n; True\n; Error\n; False\n','True\n',NULL,1712922917),(166,20,1,'deferredfeedback',52,1,1.0000000,0.0000000,1.0000000,0,'Apa yang akan dilakukan oleh fungsi berikut?\n\ndeftambah(a,b):\nreturna+b\ndefkuadrat(x):\nreturnx*x\nhasil=tambah(3,4)\nprint(kuadrat(hasil))\n: Menampilkan 49\n; Menampilkan 12\n; Menampilkan 21\n; Menampilkan 25\n','Menampilkan 49\n',NULL,1712922935),(167,20,2,'deferredfeedback',53,1,1.0000000,0.0000000,1.0000000,0,'Berapakah hasil dari eksekusi kode berikut?\n\ndefjumlah(a,b):\nreturna+b\ndefkali(a,b):\nreturna*b\nx=3\ny=5\nz=2\nhasil=kali(jumlah(x,y),z)\nprint(hasil)\n: 11\n; 26\n; 16\n; 30\n','26\n',NULL,1712922938),(168,20,3,'deferredfeedback',54,1,1.0000000,0.0000000,1.0000000,0,'Apakah yang akan dilakukan oleh fungsi ini?\n\ndefpotong_kata(kalimat,n):\nreturnkalimat[:n]\n\nteks=\"Selamatpagi!\"\nhasil=potong_kata(teks,7)\nprint(hasil)\n: Menghapus 7 karakter pertama dari teks\n; Tidak ada output yang benar\n; Mengambil 7 karakter terakhir dari teks\n; Mengambil 7 karakter pertama dari teks\n','Mengambil 7 karakter pertama dari teks\n',NULL,1712922930),(169,20,4,'deferredfeedback',55,1,1.0000000,0.0000000,1.0000000,0,'Bagaimana output dari eksekusi kode berikut?\n\ndefpangkat(x,y):\nreturnx**y\n\ndeftambah_satu(x):\nreturnx+1\n\nangka=2\nhasil=pangkat(angka,tambah_satu(angka))\nprint(hasil)\n: 8\n; 4\n; 3\n; 6\n','8\n',NULL,1712922930),(170,20,5,'deferredfeedback',56,1,1.0000000,0.0000000,1.0000000,0,'Apakah hasil dari kode berikut?\n\ndefluas_lingkaran(jari_jari):\nreturn3.14*jari_jari*jari_jari\n\ndefkeliling_lingkaran(jari_jari):\nreturn2*3.14*jari_jari\n\nr=5\nluas=luas_lingkaran(r)\nkeliling=keliling_lingkaran(r)\nprint(\"Luaslingkaran:\",luas)\nprint(\"Kelilinglingkaran:\",keliling)\n: Luas lingkaran: 125, Keliling lingkaran: 31.4\n; Luas lingkaran: 125, Keliling lingkaran: 15.7\n; Luas lingkaran: 78.5, Keliling lingkaran: 31.4\n; Luas lingkaran: 78.5, Keliling lingkaran: 15.7\n','Luas lingkaran: 78.5, Keliling lingkaran: 31.4\n',NULL,1712922930),(171,20,6,'deferredfeedback',57,1,1.0000000,0.0000000,1.0000000,0,'Berapakah hasil dari eksekusi kode berikut?\n\ndefkali_tiga(x):\nreturnx*3\n\ndeftambah_satu(x):\nreturnx+1\n\nangka=5\nhasil=tambah_satu(kali_tiga(angka))\nprint(hasil)\n: 15\n; 18\n; 16\n; 20\n','20\n',NULL,1712922930),(172,20,7,'deferredfeedback',58,1,1.0000000,0.0000000,1.0000000,0,'Apa yang akan dilakukan oleh fungsi ini?\n\ndefhitung_gaji(gaji_pokok,lembur):\nreturngaji_pokok+lembur*50000\n\ngaji=hitung_gaji(3000000,5)\nprint(gaji)\n: Tidak ada output yang benar\n; Menghitung total gaji dengan lembur\n; Menghitung gaji pokok\n; Menghitung jumlah lembur\n','Menghitung total gaji dengan lembur\n',NULL,1712922930),(173,20,8,'deferredfeedback',59,1,1.0000000,0.0000000,1.0000000,0,'Bagaimana hasil dari eksekusi kode berikut?\n\ndefhitung_kurang(a,b):\nreturnabs(a-b)\n\ndefhitung_kali(a,b):\nreturna*b\n\nhasil=hitung_kurang(hitung_kali(5,3),7)\nprint(hasil)\n: 8\n; 15\n; 2\n; 4\n','4\n',NULL,1712922930),(174,20,9,'deferredfeedback',60,1,1.0000000,0.0000000,1.0000000,0,'Apa yang akan dilakukan oleh prosedur ini?\n\ndefsapa(nama):\nprint(\"Halo,\",nama,\"!Selamatdatangdiaplikasikami.\")\nsapa(\"Andi\")\n: Tidak ada output yang benar\n; Mencetak \"Selamat datang, nama!\"\n; Mencetak \"Halo, Andi! Selamat datang di aplikasi kami.\"\n; Mengembalikan nilai \"Halo, Andi! Selamat datang di aplikasi kami.\"\n','Mencetak \"Halo, Andi! Selamat datang di aplikasi kami.\"\n',NULL,171292