INSERT INTO `mdl_quiz` VALUES (1,2,'Logika Dasar Pemrograman','Quiz ini akan menguji pemahaman tentang logika dasar dalam pemrograman komputer, termasuk konsep logika boolean, operator perbandingan, dan logika dasar.',0,0,0,0,'autosubmit',0,'deferredfeedback',0,2,0,1,2,-1,69888,0,4352,4352,0,0,4352,4352,1,'free',1,10.00000,10.00000,1712911373,1712942323,'','','-',0,0,0,0,0,0,0),(2,2,'Konsep Variabel dalam Pemrograman','Quiz ini akan menguji pemahaman tentang konsep variabel dalam pemrograman komputer, termasuk deklarasi variabel, tipe data dasar, dan aturan penamaan variabel.\r\n',0,0,0,0,'autosubmit',0,'deferredfeedback',0,0,0,1,2,-1,69888,0,4352,4096,0,0,4352,4352,1,'free',1,10.00000,10.00000,1712911613,1712923106,'','','-',0,0,0,0,0,0,0),(3,2,'Percabangan Lanjutan','Quiz ini akan menguji pemahaman tentang percabangan lanjutan seperti nested if-else, penggunaan operator logika, dan percabangan berganda dalam pemrograman komputer.\r\n',0,0,0,0,'autosubmit',0,'deferredfeedback',0,0,0,1,2,-1,69888,0,4352,4096,0,0,4352,4352,1,'free',1,10.00000,10.00000,1712911997,1712918853,'','','-',0,0,0,0,0,0,0),(4,2,'Fungsi dan Prosedur Interaktif','Quiz ini akan menguji pemahaman tentang penggunaan fungsi dan prosedur dalam pemrograman komputer dengan memperhatikan interaksi antara fungsi-fungsi yang berbeda.',0,0,0,0,'autosubmit',0,'deferredfeedback',0,0,0,1,2,-1,69888,0,4352,4096,0,0,4352,4352,1,'free',1,10.00000,10.00000,1712912078,1712920944,'','','-',0,0,0,0,0,0,0),(5,2,'Pengelolaan Memori dalam Array','Quiz ini akan menguji pemahaman tentang pengelolaan memori dalam penggunaan array dalam pemrograman komputer, termasuk alokasi memori, indeks array, dan dealokasi memori.',0,0,0,0,'autosubmit',0,'deferredfeedback',0,2,0,1,2,-1,69888,0,4352,4352,0,0,4352,4352,1,'free',1,11.00000,10.00000,1712912155,1712941008,'','','-',0,0,0,0,0,0,0),(6,3,'Quiz 1. Pengenalan Pemrograman','<p>Quiz ini ini memberikan kesempatan kepada mahasiswa untuk menunjukkan pemahaman tentang materi yang tel